import { useEffect } from "react"
import callTickets from "./api/callTickets"

export default function LdTickets() {

    useEffect(() => {
        const getData = async () => {
            let res = await callTickets()
            console.log(res)
        }

        getData()
    })

    return <div>ld-tickets</div>
}
